import React from 'react';

const getStyles = () => {
  return {
      display: "grid",
      gridTemplateColumns: "repeat(3, 1fr)",
      gridTemplateRows: "1fr",
      gridGap: "16px",
      justifyContent: "center",
      alignItems: "center",
      width:"800px",
      height: "700px"
  }
}

const cards= () => {
  return {

      width:"300px",
      height: "400px"
  }
}
const Card = ({imagelink, head, info, link}) => (
    <span className="card-container" style={getStyles()} >
      <div className="card"  style={cards()}>
        <img src={imagelink} className="card-img-top" alt="..." />
        <div className="card-body">
          <h5 className="card-title">{head}</h5>
          <p className="card-text">
           {info}
          </p>
          <a href={link} className="btn btn-primary">More info</a>
        </div>
      </div>
    </span>
);

export default Card;
